<script>function copyTitle(img) {    var textArea = document.createElement('textarea');    textArea.value = img.title;    document.body.appendChild(textArea);    textArea.select();    document.execCommand('copy');    document.body.removeChild(textArea);    var popup = document.createElement('div');    popup.innerHTML = 'Copiado!';    popup.style.position = 'fixed';    popup.style.top = '50%';    popup.style.left = '50%';    popup.style.transform = 'translate(-50%, -50%)';    popup.style.backgroundColor = 'rgba(0, 0, 0, 0.5)';    popup.style.color = '#fff';    popup.style.padding = '10px 20px';    popup.style.borderRadius = '5px';    popup.style.zIndex = '9999';    document.body.appendChild(popup);    setTimeout(function(){ popup.parentNode.removeChild(popup); }, 1000);}function toggleImages(diretorio) {    var container = document.getElementById('image-container-' + diretorio);    if (container.style.display === 'none') {        container.style.display = 'block';    } else {        container.style.display = 'none';    }}</script></body>
